package com.rising.common.cache.qo;

import java.io.Serializable;

/**
 * 
 * <p>Title : CommonCacheQo</p>
 * <p>Description : 普通缓存查询条件对象</p>
 * <p>Company : 杭州冉思科技有限公司</p>
 * @author : caoyang
 * @date : 2016年3月30日 上午10:40:03
 */
@SuppressWarnings("serial")
public class CommonCacheQo implements Serializable{
	
	/**
	 * key的前缀
	 */
	private String keyPrefix;
	
	/**
	 * 缓存key
	 */
	private String key;

	public String getKeyPrefix() {
		return keyPrefix;
	}

	public void setKeyPrefix(String keyPrefix) {
		this.keyPrefix = keyPrefix;
	}

	public String getKey() {
		return key;
	}

	public void setKey(String key) {
		this.key = key;
	}
	
	
}
